import React from 'react';
import Tile from './Tile.js'

const TileGrid = (props) => {
    return(
        <>
        <Tile name='Animdasasls' image='cat' isFolder={true} ></Tile>
        <Tile name='School' image='school' ></Tile>
        </>
    );
}

export default TileGrid;
